  input: '"TEXT","F3A","C00200584","This amendment is in response to your letter stating
    a concern with the October Quarterly Report (7/18/02-9/30/02) filed by the Upton
    for All of US Committee. In your letter dated May 20, 2002, your report indicates
    that the Column B figures for the Summary and Detailed Summary Page information
    were incorrect.  Please find the amended pages correcting this discrepancy.  You
    also stated that the committee filed a 48 hour notice disclosing a last minute
    contribution from the National Assoc. of Broadcasters.  Please note that it was
    later brought to our attention that the contribution was earmarked from Mr. Shaun
    Sheehan and is now reported correctly.  The committee has taken the necessary
    steps so this will not happen in the future.  If you have any further questions
    please let us know."'
